import HowToRegIcon from "@mui/icons-material/HowToReg";
import {
  Alert,
  AlertTitle,
  Button,
  Card,
  CardActions,
  CardContent,
  CardHeader,
  Typography,
  TextField,
  Stack,
} from "@mui/material";
import React, { useState } from "react";
import {
  useCommonsString,
  useUnRegisterCardString,
  useLoginString,
} from "../contexts/TextProvider.jsx";
import ErrorAE from "../fragments/ErrorFragment.jsx";
import SuccessAE from "../fragments/SuccessFragment.jsx";
import BlockIcon from "@mui/icons-material/Block";
import { cardRegisterStyle, centerBottonsStyle } from "../theme.jsx";

const UnRegisterCard = () => {
  const commonlabels = useCommonsString();
  const renewalstring = useUnRegisterCardString();
  const [open, setOpen] = useState(false);
  const [error, setError] = useState(false);
  const [labels, assets] = useLoginString();

  const [loginSuccess, setLoginSuccess] = React.useState(false);
  const [loginFail, setLoginFail] = React.useState(false);

  const handleSend = () => {
    setOpen(!open);
  };

  const handleClose = () => {
    setOpen(false);
  };
  return (
    <>
      <Card sx={cardRegisterStyle}>
        <CardHeader
          avatar={<BlockIcon />}
          titleTypographyProps={{ variant: "h6" }}
          title={renewalstring.mainTitle}
        />
        <CardContent>
          {open ? (
            <>
              {
                !error ? (
                  <SuccessAE first={false} />
                ) : (
                  <ErrorAE />
                ) /* TODO CAMBIAR PPOR UNO personalizado para unregister*/
              }
            </>
          ) : (
            <>
              <Alert severity="warning">
                <AlertTitle>{renewalstring.warning.title}</AlertTitle>
                <Typography sx={{ textAlign: "justify" }}>
                  {renewalstring.warning.body[0]}
                </Typography>
                <Typography sx={{ textAlign: "justify" }}>
                  {renewalstring.warning.body[1]}
                </Typography>
                <Typography sx={{ textAlign: "justify" }}>
                  {renewalstring.warning.body[2]}
                </Typography>
              </Alert>
            </>
          )}
          <Stack>
            <TextField
              id="cuil"
              label={labels.textFieldLabels.user}
              required
              disabled={loginSuccess}
              error={loginFail}
              onChange={null}
              variant="standard"
            />
            <TextField
              id="password"
              label={labels.textFieldLabels.password}
              type="password"
              required
              onChange={null}
              error={loginFail}
              disabled={loginSuccess}
              variant="standard"
            />
          </Stack>
        </CardContent>
        <CardActions sx={centerBottonsStyle}>
          <Button size="small" color="inherit">
            {commonlabels.button.cancel}
          </Button>
          <Button size="small" onClick={handleSend}>
            {commonlabels.button.ok}
          </Button>
        </CardActions>
      </Card>
    </>
  );
};

export default UnRegisterCard;
